import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import bg from "../home-bg.png"

function Home() {
    return (
        <div>
            <img src={bg}></img>
            <h1>"Drivcon Home"</h1>
            <Link to="/"><Button>Go to Portal</Button></Link>
        </div>
    );
}

export default Home;
